import React from 'react'
import Img from '../image/landing-page.jpg'
import Nav from '../Nav.js'

export default class LandingPage extends React.Component{
  render(){
    return(
      <div>
        <Nav />
        <img className="landing-img" src={Img} alt="" />
      </div>
    )
  }
}
